CREATE TABLE IF NOT EXISTS `orders` (
  `Order ID` int(11) NOT NULL AUTO_INCREMENT,
  `User ID` int(11) DEFAULT NULL,
  `Email` varchar(50) DEFAULT NULL,
  `Total Amount` int(11) DEFAULT NULL,
  `Date Ordered` timestamp NULL DEFAULT current_timestamp(),
  `Status` varchar(50) DEFAULT 'Pending',
  PRIMARY KEY (`Order ID`),
  KEY `FK_orders_accounts` (`User ID`),
  KEY `FK_orders_accounts_2` (`Email`),
  CONSTRAINT `FK_orders_accounts` FOREIGN KEY (`User ID`) REFERENCES `accounts` (`User ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_orders_accounts_2` FOREIGN KEY (`Email`) REFERENCES `accounts` (`Email`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

